Aedeagus (
Fig. 49, 51
) main-piece distally extending on right side as very large, complex, knob-shaped process; distal piece with gonopore-bearing flagellum median or nearly so, to the left of which (ventral view) are three or four processes; left paramere arcuate, setae terminally and on dorsal margin at about midlength; right paramere very slender, with about four setae at apex and six setae tightly grouped on ventral margin near basal 1/3. Female last tergite with apicomedian incision delimiting two lobes, setae slender, tapering.
